if mibBuilder.loadTexts: saCmMtaDhcpPktcOption.setDescription("This object must only be set via the CM configuration file during the provisioning process. After CM is operational, this object can not be set via SNMP. 0: CM and MTA will accept only PacketCable option 122. If option 122 is not included in CM DHCP OFFER, MTA will not start. 1: CM and MTA will accept 122 or 177 or none. If DHCP OFFER contains 122 or 177, MTA will process it. 2: CM and MTA will accept only PacketCable option 177. If option 177 is not included in CM DHCP OFFER, MTA will not start. This MIB is saved into modem's non-vol memory and the new value is active after the modem registers and reboots again (DHCP comes before config file parsing). Note: Equivalent of VSIF 64 Note: This object can be set via the CM configuration file ONLY.")
